import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class CriteriaSearchRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="schoolResults">
				<div className="name">{this.props.criteria.Name}</div>
				<div className="city">{this.props.criteria.City}</div>
				<div className="size">{this.props.criteria.Size}</div>
			</div>
		);
	}
}
